export default function Menu(props) {
    const { colorMode, toggleColorMode } = useColorMode();
    const isDark = colorMode === "dark";
    return (
        <HStack direction="row" spacing={1600} backgroundColor="gray.900" shadow="md" >
            <Heading color="white" size="sm" mr="2" m="2" p="2">
                TorrPydo
            </Heading>



        </HStack>
  );
}
